/**
 * Find a player by UUID
 * @param uuid - Player UUID
 * @returns Player data or undefined
 */
export function findPlayerByUuid(uuid: string): PlayerDTO | undefined {
  return MOCK_PLAYERS.find((p) => p.uuid === uuid)
}
